for (const item of items) {
  const data = item.json;
  stats.total++;

  try {
    // Validate required fields
    if (!data.workflowUrl || !data.title) {
      stats.invalid++;
      errors.push({ reason: 'Missing required fields', data: { title: data.title, url: data.workflowUrl } });
      console.log(`âŒ Invalid Item ${stats.total}: Missing required fields`);
      continue;
    }

    // Normalize and validate URL
    let url = data.workflowUrl.trim();
    if (url.startsWith('/')) {
      url = 'https://n8n.io' + url;
    }

    // Check for duplicates
    if (seenUrls.has(url)) {
      stats.duplicates++;
      console.log(`âš ï¸  Duplicate URL detected: ${url}`);
      continue;
    }
    seenUrls.add(url);

    // Enhanced data structure
    const processedItem = {
      // Core data
      url: url,
      title: data.title.trim(),
      category: data.category ? data.category.trim() : 'Uncategorized',
      description: data.description ? data.description.trim() : '',
      author: data.author ? data.author.trim() : 'Unknown',

      // Test metadata
      testSessionId,
      extractedAt: new Date().toISOString(),
      source: 'n8n.io',
      processingId: `scrape_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,

      // Quality indicators
      hasDescription: !!data.description,
      hasAuthor: !!data.author,
      estimatedQuality: (
        (data.description ? 2 : 0) +
        (data.author ? 1 : 0) +
        (data.category && data.category !== 'Uncategorized' ? 1 : 0)
      )
    };

    processedItems.push({ json: processedItem });
    stats.valid++;

    console.log(`âœ… Processed Item ${stats.valid}: ${processedItem.title.substring(0, 50)}...`);

  } catch (error) {
    stats.invalid++;
    errors.push({ reason: error.message, data });
    console.log(`âŒ Processing Error ${stats.invalid}: ${error.message}`);
  }
}

const processingTime = Date.now() - stepStartTime;
const successRate = stats.total > 0 ? ((stats.valid / stats.total) * 100).toFixed(2) : 0;

